import React, { Component } from 'react';
import Home from './Home';

class SignOut extends Component {
    componentDidMount = () => {
        this.props.loggedOut(false);
    }

    render() {
        return (
            <>
            <Home/>
            </>
        );
    }
}

export default SignOut;
